**Nombre de bénéficiaires en situation de handicap au regard des principales aides facultatives accordées par la Ville de Paris**
Ville de Paris propose aux Parisiens en situation de handicap un certain nombre de prestations qui visent à leur garantir un minimum de ressources, à améliorer leur vie quotidienne et à offrir des services à domicile et des structures d'accueil adaptés aux besoins de chaque personne. 
Les aides à destination de ce public sont les suivantes :
o \- une aide au transport : Pass Paris Seniors Access’ ;
o \- un complément de ressources : Paris Solidarité ;
o \- une participation au financement d’une mutuelle : Complément Santé Paris ;
o \- une aide au paiement des charges locatives : Paris Logement Personnes Agées Personnes Handicapées ;
o \- des prestations de soutien à domicile : téléalarme, coiffure, pédicurie, port de repas, aide à domicile ;
o \- des loisirs, l’Accès aux restaurants Émeraude, Opération Chocolats, L'accueil dans les établissements d'hébergement du Centre d’Action Sociale de la Ville de Paris.
Ces prestations sont soumises à certaines conditions (ex : ressources, 3 ans sur Paris…)
**Pour en savoir plus, rendez-vous dans la Maison des Solidarités (MdS) de votre arrondissement ou sur Paris.fr**
[Les aides au quotidien pour les personnes en - Ville de Paris](https://www.paris.fr/pages/les-aides-au-quotidien-pour-les-personnes-en-situation-de-handicap-25827)
[](https://www.paris.fr/services-et-infos-pratiques/aides-et-demarches/aides-allocations-et-subventions)
